--- @class UnityEngine.UIElements.Wrap By default, items will all try to fit onto one line. You can change that and allow the items to wrap as needed with this property.
UnityEngine.UIElements.Wrap = {
    --- All items will be on one line. Default Value.
    NoWrap = 0,
    --- Items will wrap onto multiple lines, from top to bottom.
    Wrap = 1,
    --- Items will wrap onto multiple lines from bottom to top.
    WrapReverse = 2,
}

